import React from 'react';
import PropTypes from 'prop-types';

//app
import { TableBody } from '@material-ui/core';
import { ClaimActionLevelTwo } from './ClaimActionLevelTwo';
ClaimActionLevelOne.prototype = {
  data: PropTypes.array.isRequired,
  columnProps: PropTypes.array.isRequired,
};

export function ClaimActionLevelOne({ data, columnProps }) {
  return (
    <TableBody data-testid="loss-action-list">
      <ClaimActionLevelTwo data={data} columnProps={columnProps} />
    </TableBody>
  );
}
